import React from "react";
import "./MainPage.css";
import Title from "./Title";
import PhoneImage from "./PhoneImage";

//testing out what the content will look like
function MainPage()
{
    return(
        <div id="content-wrapper">
            <div id="titles">
                
                    <Title
                        fontSize="150px"
                        fontWeight="lighter"
                        color="#666666"
                        text="#TECH"
                        marginTop="0px"
                    />
                    <Title
                        fontSize="50px"
                        fontWeight="lighter"
                        color="#b2b2b2"
                        text="New thinking. New #tech."
                        marginTop="-100px"
                    />
                <div id="sideContent">
                    <div>
                        <PhoneImage/>
                    </div>
                    <div></div>
                </div>
            </div>
            <div id="content"></div>
        </div>
    );
}

export default MainPage;
